import { Link, useNavigate } from 'react-router-dom';
import { useEffect, useState } from 'react';
import './loginpage.css';
import users from './user'
import img from './images/loginpage.jpg'

export default function Login() {
    const navigate = useNavigate();
    const [emailOrPhone, setEmailOrPhone] = useState('');
    const [password, setPassword] = useState('');
    const [error, setError] = useState('');
    const [showPassword, setShowPassword] = useState(false); // State to toggle password visibility

    function validateUser(emailOrPhone, password) {
        const user = users.find(user =>
            (user.email === emailOrPhone || user.phone === emailOrPhone) && user.password === password
        );
    
        return user ? true : false;
    }

    function togglePasswordVisibility() {
        setShowPassword(prevState => !prevState);
    }

    const handleLogin =  (e) => {
        e.preventDefault();
        const isValid =  validateUser(emailOrPhone, password);
        if (isValid) {
            navigate("/homepage");
        } else {
            setError("Invalid credentials. Please try again.");
        }
    };

    return (
        <div className="box">
            <div className='login-image'>
                <img src={img} alt="Login" />
            </div>
            <form className="form" onSubmit={handleLogin}>
                <h1 className="form-title">Login</h1><br /><br />

                <div className="form-group">
                    <input 
                        type="text" 
                        className="form-control" 
                        required 
                        value={emailOrPhone} 
                        onChange={(e) => setEmailOrPhone(e.target.value)}
                    />
                    <label className="form-label">Email or Phone</label>
                </div><br/><br />
                
                <div className="form-group">
                    <input 
                        type={showPassword ? "text" : "password"} 
                        className="form-control" 
                        required 
                        id="txtPassword"  
                        value={password} 
                        onChange={(e) => setPassword(e.target.value)}
                    />
                    <label className="form-label">Enter Your Password</label>
                </div><br/><br />
                
                <div className='form-show'>
                    <input 
                        type="checkbox" 
                        id="show" 
                        onChange={togglePasswordVisibility} 
                        checked={showPassword} 
                    />
                    <label className="showlabel" htmlFor="show"> Show Password</label>  
                </div><br/>

                {error && <p className="error-message">{error}</p>}

                <div className="bottom-box">
                    <button className="form-button" type="submit">Next</button>
                </div>
            </form>
        </div>
    );
}
